import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    return (
      // JSX
      //Needs to have one parent element div
      <React.Fragment>
        <h1>Hello from React</h1>
        <h2>Good bye</h2>
      </React.Fragment>
    );
  }
}

export default App;
